Christmas in Canaan (Christian Movie)


Christmas in Canaan is a beautiful story of acceptance, bravery and friendship. An unlikely friendship blossoms between two 10 year-old boys from different backgrounds during the racially charged backdrop of rural Texas, 1964. Through the years into manhood, prevailing attitudes and the growing civil rights movement severely test their friendship. In the end, they will discover that despite people's differences, it's the memories you make that determine your happiness and peace in life. 

Runtime: 87 mins
Language: English
Year: 2010
Quality: 10/10 
